import React from 'react';
import './sign-in.styles.scss';
import { useState } from 'react';
import FormInput from '../form-input/form-input.component';
export default function SignIn(){
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    return(
        <div className='sign-in'>
            <h2>Already have an account</h2>
            <span>Sign in With your email and password</span>

            <form onSubmit={(e)=>{
                console.log(email, password);
                e.preventDefault()}}>
                <FormInput label="email" onChange={(e)=>setEmail(e.target.value)} type="email" name='email' required value={email} />
                <label >Email</label>
                <FormInput label="password" type="password" name='password' onChange={(e)=>setPassword(e.target.value)} required value={password} />
                <label >Password</label>
                <input type="submit" value="Submit Form"/>
            </form>

        </div>
    )
}
